import "./style.css"
//import styled from "styled-components";
export default function Buttons() {
  const buttons = ["+", "7", "8", "9" , "-", "4" , "5" ,"6"  , "*", "1", "2" ,"3" , "/", "0", "."];
  return(
    <div>
      <h1>React Calculator</h1>
      {buttons.map((x) => {
        <button>{x}</button>
      })}
    </div>
  );

}
